import Link from 'next/link';
import image from '../img/889199.png'

const Navbar = () => (

    <nav className="main-navbar">
        <div>
            <img src={image} alt="" />
        </div>
        <input className="search-input" type="text" placeholder="Search" />

        <div>
            <p>Sign in</p>
        </div>
    </nav>

);

export default Navbar;
